    <style>
        body {
            background-color: white;
            text-align: center;
            margin: 0;
            padding: 0;
            font-family: var(--font-family-text,vw-text,Helvetica,Arial,sans-serif);
            font-weight: normal;
            font-size: var(--textappearances-copy200-fontsize);
            line-height: var(--textappearances-copy200-lineheight);

        h1 {
            font-weight: 200;
            font-size: 32px;
        }

        p {
            margin-top: 20px;
            margin-bottom:40px;
        }

            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
            width: 100%;
            position: fixed;
            top: 0;
            left: 0;
            background: rgba(0, 0, 0, 0.5);
            z-index: 999;
        }

        .popup-box {
            background: white;
            padding: 20px 30px 40px 30px;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.3);
        }

        #submit-button {
            background: rgb(0, 30, 80);
            border: 2px solid rgb(0, 30, 80);
            color: white;
            padding: 15px 30px;
            text-decoration: none;
            border: none;
            border-radius: 5px;
            margin: 20px auto 0 auto;
        }
    </style>
</head>
